import { Given,When, Then } from "cucumber"

Given("User Open website MMAP", () => {
    browser.url("https://staging.app.magicmap.com.au/");
  });

When("User input all valid infomation", () => {
    browser.findElement('input[id="user_email"]').type('tan@spiderbox.design');
    browser.getElementAttribute('input[id="user_password"]').type('12345679');
    browser.getElementAttribute('button[name="button"]').click();
})
Then("User create account successful", () => {
    browser.getElementAttribute('//*[text()="Dashboard"]').and(($h1) => {
        expect($h1.get(0).textContent, 'Dashboard').to.equal('Dashboard')
    })
})

